import React from "react"

export const AboutExperiences = () => {
    const experiences = [
        {employer: "Pellissippi State Community College", position: "Teaching Assistant for General Chemistry I", date: "Jan. 2023 - May 2023"},
    ]

    return (
        <>
            <h2 className="Experiences-Title">Experiences</h2>
            {experiences.map((experience, key) => (
                <div className="Experience-Item">
                    <div className="Experience-Date">{experience.date}</div>
                    <div>
                        <h2 className="Experience-Position">
                            <span className="Experience-Employer">
                                <span>{experience.employer}</span>
                            </span>

                        </h2>
                    </div>
                </div>
            ))}
        </>
    )
}

export default AboutExperiences;
